import { Box, Typography } from "@mui/material";
import MyButton from "./MyButton";
import { useNavigate } from "react-router-dom";
import BaseBox from "./BaseBox";

const OrderListSecond = ({ setPageNumber }) => {
  const navigate = useNavigate();
  return (
    <BaseBox>
      <Box width="700px">
        <Typography variant="h5" fontWeight="700">
          1. 운송타입 선택
        </Typography>
        <Typography>2. 화물정보 입력</Typography>
        <Typography>3. 배송옵션 입력</Typography>
      </Box>
      <Box width="300px" my={5} display="flex" justifyContent="space-between">
        <MyButton
          type="negative"
          value="뒤로 가기"
          onClick={() => {
            setPageNumber(1);
          }}
          sx={{ width: "100px", height: "50px" }}
        />
        <MyButton
          value="결과 조회"
          onClick={() => {
            navigate("/OrderResult");
          }}
          sx={{ width: "100px", height: "50px" }}
        />
      </Box>
    </BaseBox>
  );
};

export default OrderListSecond;
